46.query:
fetch dt.system.query_executions
| filter client.application_context == "dynatrace.classic.dashboard-log-tile"
| dedup query_id
| summarize {
    query_count=count(),
    queries = collectDistinct(query_id),
    dashboards = collectDistinct(client.source),
    users = collectDistinct(user.email)
  }, by:{
    query_string,
    bin(timestamp, 30m)
  }
| filter query_count >= 25 // at least 25 executions per 30 minutes
| summarize {
    executions = toLong(sum(query_count)),
    dashboards = collectDistinct(dashboards),
    users = collectDistinct(users)
  }, by:{
    query_string
  }
| fields query_string, executions, dashboards=arrayFlatten(dashboards), users = arrayFlatten(users)

48.query:
fetch dt.system.events//, from:"'+$dt_timeframe_from+'", to:"'+$dt_timeframe_to+'"';
| filter event.kind == "BILLING_USAGE_EVENT"
| filter event.type == "Log Management & Analytics - Query"
| filter event.version == "1.0"
| filter in("ALL", $User) OR in(user.email, $User)
| filter in("ALL", $Application) OR in(client.application_context, $Application)
| fieldsAdd data = "Logs"
| summarize {
  query_start = takeFirst(query_start),
  billed_bytes = takeFirst(billed_bytes),
  User = takeFirst(user.email),
  app = takeFirst(client.application_context)
    }, by:{data, event.id}
| fieldsAdd query_start_timestamp = timestampFromUnixMillis(query_start)
| summarize {
  query_volume = sum(billed_bytes),
  query_count = count()
    }, by:{data, User, app}
| fieldsAdd query_cost = query_volume/1024/1024/1024*toDouble($Price)
| fields User, App=app, `Query volume (user/app)`=query_volume, `Query cost (user/app)`=query_cost, `Query count (user/app)`=query_count
| sort `Query volume (user/app)` desc
| limit 50
